INSERT INTO `product` VALUES ('04af59c2-3c0b-4cb1-bd28-1b98926f5c47','1','Set of 8pcs X 30 LED (240 LED Lights)','<p>30LED*8PCS white LED meteror shower rain Tube lights outdoor tree decoration</p>\r\n\r\n<h4>Features:</h4>\r\n\r\n<p>Meteor effect, romantic aesthetic</p>\r\n\r\n<p>white colored LED lights emulate falling snow in the night sky</p>\r\n\r\n<p>Low-voltage power supply</p>\r\n\r\n<p>The light of every bulb turns on and out one by one in sequence and quickly</p>\r\n\r\n<p>Waterproof, dustproof, corrosion resistant, free from time and space constraints</p>\r\n\r\n<p>Application: Market Engineering lighting, architectural decoration, decoration of trees along streets, parks, decoration, decorative river, urban night lighting, Attractions landscaping, gardening, community night crystal decoration, hotels, shopping malls, night entertainment all over the environment decoration, home etc</p>\r\n\r\n<p>LED Qty: 30LED x 8 Tubes ( 240pcs LED)</p>\r\n\r\n<p>Plug Type: EU standard&nbsp;</p>\r\n\r\n<p>Light Color: white</p>\r\n\r\n<p>Working Voltage: 100V-240V</p>\r\n\r\n<p>Color: As shown in the picture</p>\r\n\r\n<p>Each Tube Length: 50cm&nbsp;</p>\r\n\r\n<h4><br />\r\nPackage Included:</h4>\r\n\r\n<p>1 x Meteor Light (8 Tubes / Set)&nbsp;</p>\r\n\r\n<p>Weight:0.48 KG</p>\r\n','./UploadedImages/1378778347571_feature1.jpg',0,'','','1',123),('5c7317e7-7504-45e3-9bd6-db9219d4d34c','2c613f6f-862d-4450-93b0-e6eaa5ae0e67','100 LED String Light 10M 110V 220V Multicolour Decoration Lights For xmas Christmas Party Wedding With 8 Display Modes','<h4><span style=\"color:#000080\"><span style=\"font-family:inherit; font-size:inherit\"><span style=\"font-family:inherit; font-size:inherit\"><span style=\"font-family:inherit; font-size:32px\">Description: &nbsp;</span></span></span></span></h4>\r\n\r\n<p>It looks very beautiful in the night,and have Muliticolor,Cool White,Warm White,Yellow,Blue,Red,Green,Pink,Changeable .<br />\r\nA perfect decoration lights for Valentine&#39;s 